import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth0 } from '@auth0/auth0-react';
import LoginButton from './LoginButton';
import LogoutButton from './LogoutButton';

const Dropdown = ({ title, items }) => (
  <div className="relative group inline-block">
    <button className="font-medium">{title}</button>
    <div className="hidden group-hover:block absolute bg-white shadow-lg mt-2 py-2 w-56">
      {items.map((item, index) => (
        <Link
          key={index}
          to={`/${item.replace(/\s+/g, '-').toLowerCase()}`}
          className="block px-4 py-2 text-gray-800 hover:bg-gray-100"
        >
          {item}
        </Link>
      ))}
    </div>
  </div>
);

const Navbar = () => {
  const { user, isLoading } = useAuth0();

  const whoWeAreItems = ['Our Story', 'Our Team', 'Careers'];
  const solutionsItems = ['Investment Management', 'Corporate Banking', 'Debt Finance Consulting'];
  const insightItems = ['News', 'Event'];

  return (
    <div className="bg-white border-b-[1px] border-solid border-gainsboro-100 p-4">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo */}
        <Link to="/" className="text-2xl font-bold text-primaryblue-500">
          <img src="/RealEstateLogo.png" alt="Logo" style={{ width: '150px', height: 'auto' }} />
        </Link>

        {/* Links */}
        <div className="flex space-x-8">
          <Dropdown title="Who We Are" items={whoWeAreItems} />
          <Dropdown title="Solutions" items={solutionsItems} />
          <Dropdown title="Insight" items={insightItems} />
          {user ? (
            <>
              <Link to="/investment-products" className="font-medium hover:text-primaryblue-500">
                Investment Products
              </Link>
              <LogoutButton />
            </>
          ) : (
            <>
              <Link to="/login" className="font-medium hover:text-primaryblue-500">
                Login/Register
              </Link>
              <LoginButton />
            </>
          )}
        </div>

        {/* User Info */}
        <div className="flex items-center">
          {!isLoading && user && <span className="font-medium text-neutralgray-600">{user.name}</span>}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
